<template>
    <div class="support-page">
        <AppBar :title="$t('more.supportAuthor')"/>
        <div class="support-page-list">
            <EasyRefresh :userSelect="false">
                <!--Star项目-->
                <ListItem
                        :title="$t('more.star')"
                        @click.native="openProjectAddress">
                    <template v-slot:icon>
                        <v-icon size="25" color="orange">star</v-icon>
                    </template>
                </ListItem>
                <v-divider/>
                <!--支付宝-->
                <ListItem
                        :title="$t('more.aliPay')"
                        @click.native="openDialog(aliPayBase64)">
                    <template v-slot:icon>
                        <AliPay class="list-icon"/>
                    </template>
                </ListItem>
                <v-divider/>
                <!--微信-->
                <ListItem
                        :title="$t('more.weiXinPay')"
                        @click.native="openDialog(weiXinBase64)">
                    <template v-slot:icon>
                        <WeiXin class="list-icon"/>
                    </template>
                </ListItem>
                <v-divider/>
                <!--QQ支付-->
                <ListItem
                        :title="$t('more.qqPay')"
                        @click.native="openDialog(qqBase64)">
                    <template v-slot:icon>
                        <QQ class="list-icon"/>
                    </template>
                </ListItem>
                <v-divider/>
                <!--PayPal-->
                <ListItem
                        :title="$t('more.payPal')"
                        @click.native="openPayPal">
                    <template v-slot:icon>
                        <PayPal class="list-icon"/>
                    </template>
                </ListItem>
            </EasyRefresh>
            <!--弹窗-->
            <v-dialog v-model="showDialog" max-width="350">
                <v-card class="text-xs-center support-page-dialog-content">
                    <img :src="imgBase64">
                </v-card>
            </v-dialog>
        </div>
    </div>
</template>

<script lang="ts">
    import {Component, Vue} from 'vue-property-decorator'
    import ListItem from '../../components/ListItem.vue'
    import AppBar from '../../components/AppBar.vue'
    import AliPay from '../../icon/AliPay.vue'
    import WeiXin from '../../icon/WeiXin.vue'
    import QQ from '../../icon/QQ.vue'
    import PayPal from '../../icon/PayPal.vue'

    @Component({
        components: {
            ListItem,
            AppBar,
            AliPay,
            WeiXin,
            QQ,
            PayPal,
        },
    })
    export default class SupportPage extends Vue {
        // 显示弹窗
        private showDialog: boolean = false
        // 图片
        // tslint:disable-next-line:max-line-length
        private aliPayBase64: string = 'data:image/jpeg;base64,'
        // tslint:disable-next-line:max-line-length
        private weiXinBase64: string = 'data:image/jpeg;base64,'
        // tslint:disable-next-line:max-line-length
        private qqBase64: string = 'data:image/jpeg;base64,'
        private imgBase64: string = this.aliPayBase64

        // 打开弹出
        private openDialog(base64: string) {
            this.showDialog = true
            this.imgBase64 = base64
        }

        // 打开项目地址
        private openProjectAddress() {
            window.open('https://github.com/xuelongqy/vue-easyrefresh')
        }

        // 打开PayPal
        private openPayPal() {
            window.open('https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=334PPRBZTY3J8&source=url')
        }
    }
</script>

<style lang="scss">
    .support-page {
        width: 100%;
        height: 100%;

        .support-page-list {
            width: 100%;
            height: calc(100% - 60px);

            .list-icon {
                width: 25px;
                height: 25px;
            }
        }
        .support-page-dialog-content {
            padding: 20px;
        }
    }
</style>
